import { Image } from "react-bootstrap";
import ButtonComponent from "../Components/ButtonComponent";
const HomePage = (props) => {
    const {Color} = props
return (
    <div className=" row Cont ">
    <div className="  mt-4 col  ">
    <p className={`fonts text-${Color==="light"?"dark": "light"}`} style={{fontFamily:"'Fugaz One', cursive", marginLeft: "50px"}}><p><h1>Hii! I'm</h1></p>
    
     <div className="gradient">Nikhil Prajapati</div><h3>I'm a fresher in Full Stack Development</h3></p>
    <p className=""></p>
    </div>


    <div className="md-6 col text-center">
    <Image src={`${Color === "light" ? "/images/profile2.png": "/images/profile2.png"}`} alt="no image to preview" style={{height
    :"500px", width:"400px"}}/>
    <div className="text-center ">
    <button type="button" style={{border: `2px solid ${Color === "dark"?"white": "black" } `}} class="btn btn-outline-secondary mb-3">Download Resume</button>
    <ButtonComponent Color = {Color}/>

    </div>
    </div>
    
    </div>
)


};

export default HomePage;
